    "ibasso-dc05-decoding-amp-usb-type-c-to-3-5mm-for-android-phone-lossless-hifi-headset-earphone-audio-decoding",
  description:
    '<span style="font-size:20px;"><span style="font-family:Arial,Helvetica,sans-serif;"></span></span><span style="font-size:22px;"><span style="font-family:Arial,Helvetica,sans-serif;"><strong>Technical Specifications:</strong></span></span><span style="font-size:20px;"><span style="font-family:Arial,Helvetica,sans-serif;"><br>\nTHD+N: &lt;0.00056%<br><!--0-->\nOutput voltage: 2Vrms(300Ω load), 1.73Vrms(32Ω load)<br>\nOutput power: 140mW@16Ω, 93mW@32Ω<br>\nFrequency Response: 20Hz-40kHz<br>\nDynamic range: 121dB<br>\nSNR: 121dB<br>\nOutput Impedance: &lt;0.5Ω<br>\nWeight: 9grams<br>\nLength: 105mm<br>\nInterface: Type-C<br>\n<br>\nDC05 is the latest USB DAC from the house of iBasso. iBasso has designed it with a premium Dual DAC chipset featuring two ES9219C Sabre DAC chips. It is loaded with premium features such as HyperStream III audio architecture, Time Domain Jitter Eliminator that provides crisp high-res signal decoding with ultra-low THD+N and high dynamic range. Turn your regular smartphone into a high-end audio player with the DC05 today!!<br>\n<br>\n<strong>Premium Sabre Dual DAC Chipset:</strong><br>\nDC05 features a premium Dual DAC chipset with two high-performance ES9219C DAC chips from Sabre Technologies. The ES9219C is a third-gen chip from Sabre Technologies that provides crisp high-resolution audio signal decoding. This premium dual DAC configuration is supported by multiple in-house developed technologies including Quad DAC+, HyperStream III audio architecture, Time Domain Clock Jitter, delivering class-leading DNR of 121dB and excellent THD+N distortion ratings.<br>\n<br>\n<strong>Full MQA Decoding Support &amp; High-Res Signal Decoding:</strong><br>\nDC05 brings high-resolution MQA decoding right at your smartphone. It supports full MQA decoding ensuring the users a pure sound performance as the artist intended. It also has full support for 32-Bit/384kHz PCM and native DSD256 decoding.<br>\n<br>\n<strong>Compact On Form Factor, Big On Performance:</strong><br>\niBasso DC05 offers you splendid performance with a compact form factor. You don\'t have to worry anything about output power, background noise, or anything, simply plug in your HiFi IEMs into the DC05 and explore the world of High-resolution Music.<br>\n<br>\n<strong>Powerful Output:</strong><br>\niBasso DC05 houses a 3.5mm single-ended output port that delivers clean and powerful output. It has up to 140mW output power rating at 16Ω of load, at 32Ω DC05 provides up to 93mW of power, which is more than enough to power your IEMs and low-power requiring headphones without trouble. DC05 has an ultra-low output impedance of less than 0.5Ω making it suitable for sensitive pairs too!!<br>\n<br>\n<strong>Self-Developed USB Architecture For Precise Volume Adjustment:</strong><br>\niBasso has developed a custom volume control application that uses the latest UAC2.0 USB protocol to enable 64-step volume control by a connected source device. This allows the users to use both sensitive as well as demanding earphones/headphones with the DC05.</span></span>',
